import React from "react";

const Osheen = () => {
  return (
    <div>
      <div class="grid grid-rows-3 grid-flow-col gap-x-20 bg-lime-400 row-height h-64">
        <div class="row-span-3 bg-red-50 font-bold text-7xl ">
          {" "}
          Where comfort meets convinience
        </div>
        <div class="row-span-3 bg-white">01</div>
        <div class="row-span-3 bg-red-700 ">01</div>
      </div>
    </div>
  );
};

export default Osheen;
